# 必要なライブラリをインポートします。
import base64
import vertexai
# vertexaiからGenerativeModelとPartクラスをインポートします。
from vertexai.preview.generative_models import GenerativeModel, Part
# vertexai.preview.generative_models全体をgenerative_modelsとしてインポートします。
import vertexai.preview.generative_models as generative_models

# generate関数を定義します。これは動画から質問に答える内容を生成する関数です。
def generate():
  # まず、vertexaiを使う準備をします。プロジェクトのIDと場所を設定します。
  vertexai.init(project="gemini-409920", location="us-central1")
  # 次に、使いたいAIモデルを選びます。ここでは"gemini-1.0-pro-vision-001"という名前のモデルを使います。
  model = GenerativeModel("gemini-1.0-pro-vision-001")
  # このモデルに、動画と質問を渡して、答えを生成してもらいます。
  responses = model.generate_content(
    [video1, """Please create a haiku from this video. lang. ja"""], # video1は動画データ、指令は「この動画から俳句を作ってください。」です。
    # 生成する内容の設定をします。どれくらいの長さの答えが欲しいか、どのように答えを選ぶかなどを決めます。
    generation_config={
        "max_output_tokens": 2048, # 最大出力トークン数。これは答えの最大の長さです。
        "temperature": 1, # 温度。これは答えの多様性を決めます。低いほど確実な答えを選びます。
        "top_p": 1, # top_p。これは答えの選び方を決めるもので、1に近いほど一般的な答えを選びます。
        "top_k": 32 # top_k。これも答えの選び方を決めるもので、小さいほど一般的な答えを選びます。
    },
    # 安全設定をします。不適切な内容をブロックするための設定です。
    safety_settings={
          generative_models.HarmCategory.HARM_CATEGORY_HATE_SPEECH: generative_models.HarmBlockThreshold.BLOCK_MEDIUM_AND_ABOVE, # ヘイトスピーチを中程度以上でブロックします。
          generative_models.HarmCategory.HARM_CATEGORY_DANGEROUS_CONTENT: generative_models.HarmBlockThreshold.BLOCK_MEDIUM_AND_ABOVE, # 危険な内容を中程度以上でブロックします。
          generative_models.HarmCategory.HARM_CATEGORY_SEXUALLY_EXPLICIT: generative_models.HarmBlockThreshold.BLOCK_MEDIUM_AND_ABOVE, # 性的な内容を中程度以上でブロックします。
          generative_models.HarmCategory.HARM_CATEGORY_HARASSMENT: generative_models.HarmBlockThreshold.BLOCK_MEDIUM_AND_ABOVE, # 嫌がらせの内容を中程度以上でブロックします。
    },
    stream=True, # ストリームモードを有効にします。これは、生成される内容をリアルタイムで受け取るための設定です。
  )
  
  # 生成された答えを一つずつ見ていきます。それぞれの答えを画面に表示します。
  for response in responses:
    print(response.text, end="") # 答えを表示します。end=""は、次の答えとこの答えの間に改行を入れないための設定です。

# video1をPartクラスを使ってデータから作成します。データはbase64でデコードされ、MIMEタイプはvideo/mp4です。
video1 = Part.from_data(data=base64.b64decode("""

"""), mime_type="video/mp4")

# generate関数を呼び出します。
generate()